import { createStore } from 'redux';



export let func = ()=>{
    console.log('subscribe', store.getState())
}

export function chengeStore(state=[]){
    return state;
}
const store = createStore(chengeStore);

export const qwe = store.subscribe()


export default {chengeStore, qwe, func}
